  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };
  return (
    <>

      <Button className='Buttone' type="primary" onClick={showModal}>
       เพิ่มรายการอุปกรณ์
      </Button>
      <Button type="primary " onClick={showModal}>
       ลบรายการอุปกรณ์
      </Button>

      <Modal title="รายการ" visible={isModalVisible} onOk={handleOk} onCancel={handleCancel}>
       <AddBed />
       <AddWheelchair />
       <AddOxgenTank/>
      </Modal>


    </>
  );
};
export default AddFrom;
